def makeReplacements(input, replacements):
    for replacementName, replacementValue in replacements.items():
        input = input.replace('{{%s}}' % replacementName, replacementValue)
    return input


def getLangName(code):
    code = iso639Codes[code] if len(code) > 2 and code in iso639Codes else code
    return englishLangNames[code] if code in englishLangNames else code

if __name__ == '__main__':
    parser = argparse.ArgumentParser(description='Bootstrap an Apertium language module/pair')
    parser.add_argument('name', help='name of new Apertium language module/pair using ISO-639-3 language code')
    parser.add_argument('-a', '--analyser', help='analyser to use for all languages', choices=['lt', 'lttoolbox', 'hfst'], default='lt')
    parser.add_argument('-a1', '--analyser1', help='analyser to use for first language of pair', choices=['lt', 'lttoolbox', 'hfst'], default='lt')
    parser.add_argument('-a2', '--analyser2', help='analyser to use for second language of pair', choices=['lt', 'lttoolbox', 'hfst'], default='lt')
    parser.add_argument('-d', '--destination', help='Destination directory for new language module/pair', default=os.getcwd())
    args = parser.parse_args()
    
    if '-' in args.name:
        raise NotImplementedError
    else:
        if args.analyser in ['lt', 'lttoolbox']:
            email = 'apertium-stuff@lists.sourceforge.net' #TODO: Get email
            replacements = {'languageCode': args.name, 'languageName': getLangName(args.name), 'email': email}
            args.destination = os.path.join(args.destination, 'apertium-%s' % args.name)

            if not os.path.exists(args.destination):
                os.makedirs(args.destination)

            for filename, encodedFile in lttoolbox_language_module_files.items():
                with open(os.path.join(args.destination, makeReplacements(filename, replacements)), 'wb') as f:
                    try:
                        f.write(makeReplacements(str(base64.b64decode(encodedFile), encoding='utf-8'), replacements).encode('utf-8'))
                    except UnicodeDecodeError: # binary file
                        f.write(base64.b64decode(encodedFile))
        else:
            raise NotImplementedError
